biografia_resumen:
Slipknot is an American heavy metal band formed in Des Moines, Iowa, in 1995 by percussionist Shawn Crahan, vocalist/percussionist Anders Colsefni, and bassist Paul Gray. Following several lineup changes, the group eventually established a nine-member formation:
#0 Sid Wilson - turntables;
#1 Joey Jordison - drums;
#2 Paul Gray - bass guitar;
#3 Chris Fehn - percussion;
#4 Jim Root - guitar;
#5 Craig "133" Jones - samples and keyboard;
#6 Shawn "Clown" Crahan - percussion;
